import React, { Component } from "react";
import Aux from "../hoc/Auxiliary";
import Product from "../../components/product/product";
import "./home.css";

class Store extends Component {
  state = {
    product: {
      item: {
        img: "http://via.placeholder.com/150",
        title: "Product",
        description: "product product product product product product",
        price: 1000,
      },
    },
  };
  render() {
    return (
      <Aux>
        <div>Slider</div>
        <div className="products">
          <Product
            productImage={this.state.product.item.img}
            productTitle={this.state.product.item.title}
            productDescription={this.state.product.item.description}
            productPrice={this.state.product.item.price}
          />
        </div>
      </Aux>
    );
  }
}

export default Store;
